import React from "react"
import style from "./User.module.css"

const User = (props) => {
    return (
        <div className={style.user}>
            <div className={style.avatar}>
                <img src={props.avatar}/>
            </div>
            <div className={style.name}><span>{props.name}</span></div>
        </div>
    )
}

export default User
